(491, 21, 59, '<p>61) mawar - melati</p>;<p>62) mata-telinga</p>;<p>63) Gula-Intan</p>;<p>64) Hujan-Salju</p>;<p>65) Pengantar surat-Telepon</p>;<p>66) Kamera-Kacamata</p>;<p>67) Lambung-Usus</p>;<p>68) Banyak-sedikit</p>;<p>69) Telur-Benih</p>;<p>70) Bendera-Lencana</p>;<p>71) Rumput-Gajah</p>;<p>72) Ember-Kantong</p>;<p>73) Awal-Akhir</p>;<p>74) Kikir-Boros</p>;<p>75) Penawaran-Permintaan</p>;<p>76) Atas-Bawah</p>', '55:bunga:N,56:anggota tubuh:N,57:kristal:N,58:musim:N,59:alat komunikasi:N,60:kaca:N,61:organ:N,62:jumlah:N,63:pra reproduksi:N,64:simbol:N,65:ekosistem:N,66:wadah:N,67:proses:N,68:sifat:N,69:jual beli:N,70:arahan:N', 0, 0.00, 100.00, '2025-01-22 02:01:29', '2025-01-22 02:09:29', 'N'),
(492, 15, 59, '<p>77. Jika seorang anak memiliki 50 rupiah dan memberikan 15 rupiah kepada orang lain ,berapa rupiahkah yang masih tinggal padanya?</p>;<p>78. Berapa km-kah yang dapat ditempuh oleh kereta api dalam waktu 7 jam ,jika kecepatanya 40 km/jam?</p>;<p>79. 15 Peti buah -buahan beratnya 250 kg dan setiap peti kosong beratnya 3 kg, berapakah berat buah-buahan itu?</p>;<p>80. Seseorang mempunyai persediaan rumput yang cukup untuk 7 ekor kuda selama 78 hari. Berapa harikah persediaan itu cukup untuk 21 ekor kuda?</p>;<p>81. 3 Batang coklat harganya Rp. 5,- berapa batangkah yang dapat kita beli dengan Rp. 50,-?</p>;<p xss=removed>82. Seseorang dapat berjalan 1,75 m dalam waktu 1/4 detik.Berapa meterkah yang dapat ia tampuh dalam waktu 10 detik?</p>;<p>83. Jika sebuah batu terletak 15 m disebelah selatan dari sebatang pohon dan pohon itu berada 30 m disebelah selatan dari sebuah rumah, berapa meterkah jarak antara batu dan rumah itu?</p>;<p xss=removed>84. Jika 4 <sup>1/2</sup> m bahan sandang harganya Rp.90,-berapa rupiahkah harganya 2 <sup>1/2</sup> m?</p>;<p>85. 7 Orang dapat menyelesaikan sesuatu pekerjaan dalam 6 hari. Berapa orangkah yang diperlukan untuk menyelesaikan pekerjaan itu dalam setengah hari?</p>;<p>86. Karena dipanaskan, kawat yang panjangnya 48 cm akan mengembang menjadi 52 cm. Setelah pemanasan, berapakah panjangnya kawat yang berukuran 72 cm?</p>;<p>87. Suatu pabrik dapat menghasilkan 304 batang pensiun dalam waktu 8 jam. Berapa batangkah yang dihasilkan dalam waktu setengah jam?</p>;<p>88. Untuk suatu campuran diperlukan 2 bagian perak dan 3 bagian timah. Berapa gramkah perak yang diperlukan untuk mendapatkan campuran itu yang beratnya 15 gram?</p>;<p>89. Untuk setiap Rp. 3,- yang dimiliki Sidin, Hamid memiliki Rp.5,- Jika mereka bersama mempunyai Rp.120,- berapa rupiahkah yang dimiliki Hamid?</p>;<p>90. Mesin A menenun 60 m kain, sedangkan mesin B menenun 40 m. Berapa meterkah yang ditenun mesin A, jika mesin B menenun 60 m?</p>;<p>91. Seseorang membelikan <sup>1/10 </sup>dari uangnya untuk perangko dan 4 kali jumlah itu untuk alat tulis. Sisa uangnya masih Rp.60,- Berapa rupiahkah uangnya semula?</p>;<p>92. Didalam dua peti terdapat 43 buah piring. Di dalam peti yang satu terdapat 9 buah piring lebih banyak dari pada di dalam peti yang lain. Berapa buah piring terdapat didalam peti yang lebih kecil?</p>;<p>93. Suatu lembaran kain yang panjangnya 60 cm harus dibagi sedemikian rupa sehingga panjangmya satu bagian ialah <span xss=removed>2/3</span>dari bagian yang lain. Berapa panjangnya bagian yang terpendek?</p>;<p>94. Suatu perusahaan mengekspor 3/4 dari hasil produksinya dan menjual 4/5 dari sisa itu didalam Negeri. Berapa % kah hasil produksi yang masih tinggal?</p>;<p>95. Jika suatu botol berisi anggur hanya 7/8 bagian dan harganya ialah Rp. 84,- Berapakah harga anggur itu jika botol itu hanya terisi 1/2 penuh?</p>;<p>96. Didalam suatu keluarga setiap anak perempuan mempunyai jumlah saudara laki-laki yang sama dengan jumlah saudara perempuan dan setiap anak laki-laki mempunyai dua kali lebih banyak saudara perempuan dari pada saudara laki laki. Berapa anak laki-laki', '13:35:N,14:20:N,15:205:N,16:234:N,17:30:N,18:7:N,19:15:N,21:45:N,22:1:N,23:76:N,24:40:N,25:16:N,26:65:N,27:80:N,28:120:N,29:34:N,30:40:N,32:1:N,33:120:N,34:5:N', 3, 15.00, 100.00, '2025-01-22 02:05:58', '2025-01-22 02:15:58', 'N'),
