(495, 15, 66, '<p>77. Jika seorang anak memiliki 50 rupiah dan memberikan 15 rupiah kepada orang lain ,berapa rupiahkah yang masih tinggal padanya?</p>;<p>78. Berapa km-kah yang dapat ditempuh oleh kereta api dalam waktu 7 jam ,jika kecepatanya 40 km/jam?</p>;<p>79. 15 Peti buah -buahan beratnya 250 kg dan setiap peti kosong beratnya 3 kg, berapakah berat buah-buahan itu?</p>;<p>80. Seseorang mempunyai persediaan rumput yang cukup untuk 7 ekor kuda selama 78 hari. Berapa harikah persediaan itu cukup untuk 21 ekor kuda?</p>;<p>81. 3 Batang coklat harganya Rp. 5,- berapa batangkah yang dapat kita beli dengan Rp. 50,-?</p>;<p xss=removed>82. Seseorang dapat berjalan 1,75 m dalam waktu 1/4 detik.Berapa meterkah yang dapat ia tampuh dalam waktu 10 detik?</p>;<p>83. Jika sebuah batu terletak 15 m disebelah selatan dari sebatang pohon dan pohon itu berada 30 m disebelah selatan dari sebuah rumah, berapa meterkah jarak antara batu dan rumah itu?</p>;<p xss=removed>84. Jika 4 <sup>1/2</sup> m bahan sandang harganya Rp.90,-berapa rupiahkah harganya 2 <sup>1/2</sup> m?</p>;<p>85. 7 Orang dapat menyelesaikan sesuatu pekerjaan dalam 6 hari. Berapa orangkah yang diperlukan untuk menyelesaikan pekerjaan itu dalam setengah hari?</p>;<p>86. Karena dipanaskan, kawat yang panjangnya 48 cm akan mengembang menjadi 52 cm. Setelah pemanasan, berapakah panjangnya kawat yang berukuran 72 cm?</p>;<p>87. Suatu pabrik dapat menghasilkan 304 batang pensiun dalam waktu 8 jam. Berapa batangkah yang dihasilkan dalam waktu setengah jam?</p>;<p>88. Untuk suatu campuran diperlukan 2 bagian perak dan 3 bagian timah. Berapa gramkah perak yang diperlukan untuk mendapatkan campuran itu yang beratnya 15 gram?</p>;<p>89. Untuk setiap Rp. 3,- yang dimiliki Sidin, Hamid memiliki Rp.5,- Jika mereka bersama mempunyai Rp.120,- berapa rupiahkah yang dimiliki Hamid?</p>;<p>90. Mesin A menenun 60 m kain, sedangkan mesin B menenun 40 m. Berapa meterkah yang ditenun mesin A, jika mesin B menenun 60 m?</p>;<p>91. Seseorang membelikan <sup>1/10 </sup>dari uangnya untuk perangko dan 4 kali jumlah itu untuk alat tulis. Sisa uangnya masih Rp.60,- Berapa rupiahkah uangnya semula?</p>;<p>92. Didalam dua peti terdapat 43 buah piring. Di dalam peti yang satu terdapat 9 buah piring lebih banyak dari pada di dalam peti yang lain. Berapa buah piring terdapat didalam peti yang lebih kecil?</p>;<p>93. Suatu lembaran kain yang panjangnya 60 cm harus dibagi sedemikian rupa sehingga panjangmya satu bagian ialah <span xss=removed>2/3</span>dari bagian yang lain. Berapa panjangnya bagian yang terpendek?</p>;<p>94. Suatu perusahaan mengekspor 3/4 dari hasil produksinya dan menjual 4/5 dari sisa itu didalam Negeri. Berapa % kah hasil produksi yang masih tinggal?</p>;<p>95. Jika suatu botol berisi anggur hanya 7/8 bagian dan harganya ialah Rp. 84,- Berapakah harga anggur itu jika botol itu hanya terisi 1/2 penuh?</p>;<p>96. Didalam suatu keluarga setiap anak perempuan mempunyai jumlah saudara laki-laki yang sama dengan jumlah saudara perempuan dan setiap anak laki-laki mempunyai dua kali lebih banyak saudara perempuan dari pada saudara laki laki. Berapa anak laki-laki', '13:35 rupiah:N,14:280:N,15:205:N,16:26 hari:N,17:30:N,18:70 m:N,19:45 m:N,21:50:N,22:84:N,23:78:N,24:19:N,25:6 g:N,26:75:N,27:90 m:N,28:120:N,29:30:N,30:20:N,32:12:N,33:1:N,34:23:N', 5, 25.00, 100.00, '2025-01-22 13:55:40', '2025-01-22 14:05:40', 'N'),
