(567, 15, 96, '<p>77. Jika seorang anak memiliki 50 rupiah dan memberikan 15 rupiah kepada orang lain ,berapa rupiahkah yang masih tinggal padanya?</p>;<p>78. Berapa km-kah yang dapat ditempuh oleh kereta api dalam waktu 7 jam ,jika kecepatanya 40 km/jam?</p>;<p>79. 15 Peti buah -buahan beratnya 250 kg dan setiap peti kosong beratnya 3 kg, berapakah berat buah-buahan itu?</p>;<p>80. Seseorang mempunyai persediaan rumput yang cukup untuk 7 ekor kuda selama 78 hari. Berapa harikah persediaan itu cukup untuk 21 ekor kuda?</p>;<p>81. 3 Batang coklat harganya Rp. 5,- berapa batangkah yang dapat kita beli dengan Rp. 50,-?</p>;<p xss=removed>82. Seseorang dapat berjalan 1,75 m dalam waktu 1/4 detik.Berapa meterkah yang dapat ia tampuh dalam waktu 10 detik?</p>;<p>83. Jika sebuah batu terletak 15 m disebelah selatan dari sebatang pohon dan pohon itu berada 30 m disebelah selatan dari sebuah rumah, berapa meterkah jarak antara batu dan rumah itu?</p>;<p xss=removed>84. Jika 4 <sup>1/2</sup> m bahan sandang harganya Rp.90,-berapa rupiahkah harganya 2 <sup>1/2</sup> m?</p>;<p>85. 7 Orang dapat menyelesaikan sesuatu pekerjaan dalam 6 hari. Berapa orangkah yang diperlukan untuk menyelesaikan pekerjaan itu dalam setengah hari?</p>;<p>86. Karena dipanaskan, kawat yang panjangnya 48 cm akan mengembang menjadi 52 cm. Setelah pemanasan, berapakah panjangnya kawat yang berukuran 72 cm?</p>;<p>87. Suatu pabrik dapat menghasilkan 304 batang pensiun dalam waktu 8 jam. Berapa batangkah yang dihasilkan dalam waktu setengah jam?</p>;<p>88. Untuk suatu campuran diperlukan 2 bagian perak dan 3 bagian timah. Berapa gramkah perak yang diperlukan untuk mendapatkan campuran itu yang beratnya 15 gram?</p>;<p>89. Untuk setiap Rp. 3,- yang dimiliki Sidin, Hamid memiliki Rp.5,- Jika mereka bersama mempunyai Rp.120,- berapa rupiahkah yang dimiliki Hamid?</p>;<p>90. Mesin A menenun 60 m kain, sedangkan mesin B menenun 40 m. Berapa meterkah yang ditenun mesin A, jika mesin B menenun 60 m?</p>;<p>91. Ses