eorang membelikan <sup>1/10 </sup>dari uangnya untuk perangko dan 4 kali jumlah itu untuk alat tulis. Sisa uangnya masih Rp.60,- Berapa rupiahkah uangnya semula?</p>;<p>92. Didalam dua peti terdapat 43 buah piring. Di dalam peti yang satu terdapat 9 buah piring lebih banyak dari pada di dalam peti yang lain. Berapa buah piring terdapat didalam peti yang lebih kecil?</p>;<p>93. Suatu lembaran kain yang panjangnya 60 cm harus dibagi sedemikian rupa sehingga panjangmya satu bagian ialah <span xss=removed>2/3</span>dari bagian yang lain. Berapa panjangnya bagian yang terpendek?</p>;<p>94. Suatu perusahaan mengekspor 3/4 dari hasil produksinya dan menjual 4/5 dari sisa itu didalam Negeri. Berapa % kah hasil produksi yang masih tinggal?</p>;<p>95. Jika suatu botol berisi anggur hanya 7/8 bagian dan harganya ialah Rp. 84,- Berapakah harga anggur itu jika botol itu hanya terisi 1/2 penuh?</p>;<p>96. Didalam suatu keluarga setiap anak perempuan mempunyai jumlah saudara laki-laki yang sama dengan jumlah saudara perempuan dan setiap anak laki-laki mempunyai dua kali lebih banyak saudara perempuan dari pada saudara laki laki. Berapa anak laki-laki', '13:35 RUPIAH:N,14:500 km:N,15:3750 kg:N,16:234 hari:N,17:30 batang:N,18:70 meter:N,19:45meter:N,21:Rp 45:N,22:1 orang:N,23:78 cm:N,24:19.25:N,25::N,26::N,27::N,28::N,29::N,30::N,32::N,33::N,34::N', 0, 0.00, 100.00, '2025-02-18 23:38:17', '2025-02-18 23:48:17', 'N'),
