INSERT INTO `m_ujian` (`id_ujian`, `dosen_id`, `matkul_id`, `nama_ujian`, `instruksi`, `jumlah_soal`, `waktu`, `jenis`, `tgl_mulai`, `terlambat`, `token`) VALUES
(22, 25, 2, 'SUBTES A', '<p xss=removed>Lengkapilah pernyataan berikut dengan memilih\r\nsalah satu jawaban di\r\npilihan ganda</p><p xss=removed></p><p xss=removed>Contoh: </p><p xss=removed>Seekor kuda memiliki kesamaan terbanyak dengan seekor</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><div xss=removed>a.Kucing b. Bajing c.\r\nKeledai d. Lembu e.\r\nAnjing</div>', 20, 6, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'EZCVO'),
(23, 25, 1, 'SUBTES B', '<p xss=removed>Bagian\r\nsoal berikut terdiri dari\r\nlima kata (a, b, c, d, dan e). Empat dari\r\nlima kata tersebut memiliki kesamaan. Carilah\r\nkata kelima\r\nyang tidak memiliki kesamaan dengan\r\nkata lainnya</p>', 20, 6, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'GDHMD'),
(24, 25, 9, 'SUBTES C', '<p xss=removed>Terdapat tiga\r\nkata. Antara kata pertama dan kata kedua punya hubungan. Antara kata ketiga dan salah satu diantara\r\nkata pilihan harus\r\njuga terdapat hubungan\r\nyang sama, maka carilah\r\nkata yang dimaksud.<br><br></p><p xss=removed>Hutan : Pohon = tembok :\r\n?</p><p xss=removed>\r\n\r\n</p><p xss=removed>a.\r\nBatu bata b. rumah c.\r\nsemen d. putih e.\r\ndinding</p>', 20, 7, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'OBCXS'),
(28, 25, 15, 'SUBTES G', '<p xss=removed>Terdapat gambar a, b, c, d, dan e. Soal-soal berikut terdiri dari potongan-potongan gambar yang\r\napabila digabungkan, disusun sedemikan rupa akan menjadi gambar utuh tanpa kelebihan sudut/ruang. Carilah gambar tersebut</p>', 20, 8, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'KWQLI'),
(29, 25, 16, 'SUBTES H', '<p xss=removed>Terdapat kubus a, b, c, d, dan e. Setiap kubus memiliki 6 sisi setiap sisi terdapat tanda yang\r\nberlainan, 3 tanda bisa terlihat dan\r\n3 tanda lain\r\nbelum terlihat. Kubus-kubus ini berbeda, artinya kubus-kubus itu\r\npunya tanda yang\r\nsama, tetapi susunannya berlainan.</p><p xss=removed></p><p>\r\n\r\n\r\n\r\n</p><p xss=removed>Setiap soal merupakan salah satu dari 5 kubus dengan posisi/kedudukan yang berbeda. Tugas Anda, carilah kubus yang dimaksud. Kubus ini dapat diputar, digulingkan, diputar dan digulingkan di pikiran Anda sehingga mungkin saja terdapat tanda baru.</p>', 20, 9, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'TMXSU'),
(30, 25, 17, 'SUBTES I', '<p>Sebelum memulai pastikan saudara telah membuka bagian \"PENGANTAR TES INTELEGENSI 1 SUBTEST 1\".</p><p>Pada bagian ini adalah soal dari kata-kata yang telah anda hafalkan pada bagian \"PENGANTAR TES INTELEGENSI 1 SUBTEST 1\"</p>', 20, 6, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'AKTHF'),
(35, 25, 22, 'PENGANTAR SUBTES I', '<p>Silakan hafalkan kata-kata berikut untuk menjawab soal Tes Intelegensi 1 Subtest I</p>', 1, 3, 'urut', '2024-11-29 10:57:40', '2025-02-27 23:00:00', 'RGLCR');
INSERT INTO `m_ujianessay` (`id_UjianEssay`, `dosen_id`, `matkul_id`, `nama_ujian`, `instruksi`, `jumlah_soal`, `waktu`, `jenis`, `tgl_mulai`, `terlambat`, `token`) VALUES
(15, 25, 13, 'SUBTES E', '<p>Persoalan berikutnya ialah soal-soal hitungan.</p><p>Contoh</p><p>Sebatang pensil harganya 25 rupiah. Berapakah harga 3 batang?</p><p>Jawabannya ialah: 75</p><p>Cukup tulis angkanya saja, TANPA menulis satuan (rp/ meter)</p>', 20, 10, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'JXFTO'),
(17, 25, 14, 'SUBTES F', '<p>Pada persoalan berikut akan diberikan deret angka.</p><p>Contoh</p><p>2, 4, 6, 8, 10, 12, 14, ?</p><p>Jawaban: 16</p>', 20, 10, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'HXGDN'),
(21, 25, 3, 'SUBTES D', '<p>Ditentukan dua kata.</p><p>Carilah satu perkataan yang meliputi pengertian kedua kata tadi.</p><p>Tulislah perkataan itu pada kolom yang tersedia.</p><p><br></p><p>Contoh</p><p>Ayam - itik</p><p>Perkataan \"burung\" dapat meliputi kedua kata tadi.</p><p>Maka tulis di kolom: burung</p>', 16, 8, 'urut', '2024-11-29 08:00:00', '2025-02-27 23:00:00', 'ZBESV');
