(97, 25, 2, 1, '', '', '<p>18.<span xss=removed>Di\r\nantara kota-kota berikut ini, maka kotaletaknya paling selatan</span></p>', '<p>a) Jakarta</p>', '<p>b) Bandung</p>', '<p>c) Cirebon</p>', '<p>d) Semarang</p>', '<p>e) Surabaya</p>', '', '', '', '', '', 'B', 1653637071, 1653637348),
