(202, 25, 2, 1, '', '', '<p>1. Pengaruh seseorang terhadap orang lain seharusnya bergantung pada...</p>', '<p>a) kekuasaan</p>', '<p>b) bujukan</p>', '<p>c) kekayaan</p>', '<p>d) keberanian</p>', '<p>e) kewibawaan</p>', '', '', '', '', '', 'E', 1664175730, 1664175730),
(203, 25, 2, 1, '', '', '<p>2. Lawannya \"hemat\" adalah...</p>', '<p>a) murah</p>', '<p>b) kikir</p>', '<p>c) boros</p>', '<p>d) bernilai</p>', '<p>e) kaya</p>', '', '', '', '', '', 'C', 1664175793, 1664175793),
(204, 25, 2, 1, '', '', '<p>3. ....... tidak termasuk cuaca.</p>', '<p>a) angin puyuh</p>', '<p>b) halilintar</p>', '<p>c) salju</p>', '<p>d) gempa bumi</p>', '<p>e) kabut</p>', '', '', '', '', '', 'D', 1664175856, 1664175856),
(205, 25, 2, 1, '', '', '<p>4. Lawannya \"setia\" adalah...</p>', '<p>a) cinta</p>', '<p>b) benci</p>', '<p>c) persahabatan</p>', '<p>d) khianat</p>', '<p>e) permusuhan</p>', '', '', '', '', '', 'D', 1664175929, 1664175929),
(206, 25, 2, 1, '', '', '<p>5. Seekor kuda selalu mempunyai...</p>', '<p>a) kandang</p>', '<p>b) ladam</p>', '<p>c) pelana</p>', '<p>d) kuku</p>', '<p>e) surai</p>', '', '', '', '', '', 'D', 1664175992, 1664175992),
(207, 25, 2, 1, '', '', '<p>6. Seorang paman.... lebih tua dari kemenakannya.</p>', '<p>a) jarang</p>', '<p>b) biasanya</p>', '<p>c) selalu</p>', '<p>d) tidak pernah</p>', '<p>e) kadang-kadang</p>', '', '', '', '', '', 'B', 1664176058, 1664176058),
(208, 25, 2, 1, '', '', '<p>7. Pada jumlah yang sama, nilai kalori yang tertinggi terdapat pada...</p>', '<p>a) ikan</p>', '<p>b) daging</p>', '<p>c) lemak</p>', '<p>d) tahu</p>', '<p>e) sayuran</p>', '', '', '', '', '', 'C', 1664176135, 1664176135),
(209, 25, 2, 1, '', '', '<p>8. Pada suatu pertandingan selalu terdapat...</p>', '<p>a) lawan</p>', '<p>b) wasit</p>', '<p>c) penonton</p>', '<p>d) sorak</p>', '<p>e) kemenangan</p>', '', '', '', '', '', 'A', 1664176201, 1664176201),
(210, 25, 2, 1, '', '', '<p>9. Suatu pernyataan yang belum dipastikan, disebut sebagai pernyataan yang...</p>', '<p>a) paradoks</p>', '<p>b) tergesa-gesa</p>', '<p>c) mempunyai arti rangkap</p>', '<p>d) menyesatkan</p>', '<p>e) hipotesis</p>', '', '', '', '', '', 'E', 1664176312, 1664176312),
(211, 25, 2, 1, '', '', '<p>10. Pada sepatu selalu terdapat...</p>', '<p>a) kulit</p>', '<p>b) sol</p>', '<p>c) tali sepatu</p>', '<p>d) gesper</p>', '<p>e) lidah</p>', '', '', '', '', '', 'B', 1664176371, 1664176371),
(219, 25, 22, 1, '', '', '<p>Hafalkankata-kata berikut selama3menit.</p><p xss=\"removed\"></p><p xss=\"removed\">BUNGA:Soka,Larat,Flamboyan, Yasmin, Dahlia</p><p xss=\"removed\">PERKAKAS:Wajan,Jarum,Kikir,Cangkul,Palu</p><p xss=\"removed\">BURUNG:Itik,Elang,Walet,Tekukur, Nuri</p><p xss=\"removed\">KESENIAN: Quintet, Arca, Opera, Gamelan,Ukiran</p><p xss=\"removed\">BINTANG: Musang,Rusa,Beruang, Zebra,Harimau</p>', '<p>hafal</p>', '<p>hafal<br></p>', '<p>hafal<br></p>', '<p>hafal<br></p>', '<p>hafal<br></p>', '', '', '', '', '', 'A', 1722908161, 1722911140);
