(13, 25, 13, '<p>77. Jika seorang anak memiliki 50 rupiah dan memberikan 15 rupiah kepada orang lain ,berapa rupiahkah yang masih tinggal padanya?</p>', '', '', '35', 1, 1660544798, 1663209027),
(14, 25, 13, '<p>78. Berapa km-kah yang dapat ditempuh oleh kereta api dalam waktu 7 jam ,jika kecepatanya 40 km/jam?</p>', '', '', '280', 1, 1660544884, 1663209037),
(15, 25, 13, '<p>79. 15 Peti buah -buahan beratnya 250 kg dan setiap peti kosong beratnya 3 kg, berapakah berat buah-buahan itu?</p>', '', '', '250', 1, 1660544977, 1663209046),
(16, 25, 13, '<p>80. Seseorang mempunyai persediaan rumput yang cukup untuk 7 ekor kuda selama 78 hari. Berapa harikah persediaan itu cukup untuk 21 ekor kuda?</p>', '', '', '26', 1, 1660545073, 1663209058),
(17, 25, 13, '<p>81. 3 Batang coklat harganya Rp. 5,- berapa batangkah yang dapat kita beli dengan Rp. 50,-?</p>', '', '', '30', 1, 1660545152, 1663209262),
(18, 25, 13, '<p xss=removed>82. Seseorang dapat berjalan 1,75 m dalam waktu 1/4 detik.Berapa meterkah yang dapat ia tampuh dalam waktu 10 detik?</p>', '', '', '70', 1, 1660545364, 1663209273),
(19, 25, 13, '<p>83. Jika sebuah batu terletak 15 m disebelah selatan dari sebatang pohon dan pohon itu berada 30 m disebelah selatan dari sebuah rumah, berapa meterkah jarak antara batu dan rumah itu?</p>', '', '', '45', 1, 1660545516, 1663209294),
(21, 25, 13, '<p xss=removed>84. Jika 4 <sup>1/2</sup> m bahan sandang harganya Rp.90,-berapa rupiahkah harganya 2 <sup>1/2</sup> m?</p>', '', '', '50', 1, 1660545831, 1663209316),
(22, 25, 13, '<p>85. 7 Orang dapat menyelesaikan sesuatu pekerjaan dalam 6 hari. Berapa orangkah yang diperlukan untuk menyelesaikan pekerjaan itu dalam setengah hari?</p>', '', '', '48', 1, 1660545929, 1663209332),
(23, 25, 13, '<p>86. Karena dipanaskan, kawat yang panjangnya 48 cm akan mengembang menjadi 52 cm. Setelah pemanasan, berapakah panjangnya kawat yang berukuran 72 cm?</p>', '', '', '78', 1, 1660546033, 1663209433),
(24, 25, 13, '<p>87. Suatu pabrik dapat menghasilkan 304 batang pensiun dalam waktu 8 jam. Berapa batangkah yang dihasilkan dalam waktu setengah jam?</p>', '', '', '9', 1, 1660546167, 1663209423),
(25, 25, 13, '<p>88. Untuk suatu campuran diperlukan 2 bagian perak dan 3 bagian timah. Berapa gramkah perak yang diperlukan untuk mendapatkan campuran itu yang beratnya 15 gram?</p>', '', '', '6', 1, 1660546306, 1663209401),
(26, 25, 13, '<p>89. Untuk setiap Rp. 3,- yang dimiliki Sidin, Hamid memiliki Rp.5,- Jika mereka bersama mempunyai Rp.120,- berapa rupiahkah yang dimiliki Hamid?</p>', '', '', '5', 1, 1660546478, 1663209447),
(27, 25, 13, '<p>90. Mesin A menenun 60 m kain, sedangkan mesin B menenun 40 m. Berapa meterkah yang ditenun mesin A, jika mesin B menenun 60 m?</p>', '', '', '90', 1, 1660546592, 1663209468),
(28, 25, 13, '<p>91. Seseorang membelikan <sup>1/10 </sup>dari uangnya untuk perangko dan 4 kali jumlah itu untuk alat tulis. Sisa uangnya masih Rp.60,- Berapa rupiahkah uangnya semula?</p>', '', '', '120', 1, 1660546730, 1663209479),
(29, 25, 13, '<p>92. Didalam dua peti terdapat 43 buah piring. Di dalam peti yang satu terdapat 9 buah piring lebih banyak dari pada di dalam peti yang lain. Berapa buah piring terdapat didalam peti yang lebih kecil?</p>', '', '', '17', 1, 1660546858, 1663209494),
(30, 25, 13, '<p>93. Suatu lembaran kain yang panjangnya 60 cm harus dibagi sedemikian rupa sehingga panjangmya satu bagian ialah <span xss=removed>2/3</span>dari bagian yang lain. Berapa panjangnya bagian yang terpendek?</p>', '', '', '1', 1, 1660546996, 1660546996),
(32, 25, 13, '<p>94. Suatu perusahaan mengekspor 3/4 dari hasil produksinya dan menjual 4/5 dari sisa itu didalam Negeri. Berapa % kah hasil produksi yang masih tinggal?</p>', '', '', '5', 1, 1660547126, 1663209520),
(33, 25, 13, '<p>95. Jika suatu botol berisi anggur hanya 7/8 bagian dan harganya ialah Rp. 84,- Berapakah harga anggur itu jika botol itu hanya terisi 1/2 penuh?</p>', '', '', '48', 1, 1660547259, 1663209539),
(34, 25, 13, '<p>96. Didalam suatu keluarga setiap anak perempuan mempunyai jumlah saudara laki-laki yang sama dengan jumlah saudara perempuan dan setiap anak laki-laki mempunyai dua kali lebih banyak saudara perempuan dari pada saudara laki laki. Berapa anak laki-laki', '', '', '3', 1, 1660547474, 1663209552),
